import styled, {keyframes} from 'styled-components';


export const InputClassic = styled.input`
  background-color: white;
  caret-color:black;
  border-color:black;
  color:white;
  font-family: Orbitron , sans-serif;
  font-size: 50px;
  text-shadow: 1px 1px 10px white;
  outline:none;
  border-radius: 5px;
  height:50px;
  width:100%;
`
export const Label = styled.label`
    color:white;
`
